import React from "react";
import "./Glowna.css";

export default function Glowna() {
  return (
    <div>
      <div className="Naglowek">
        <h2>O NAS</h2>
      </div>
      

      <div className="first">
        {/* <p>
          <b>Biuro rachunkowe BALANS</b> powstało z myślą o ludziach, którzy
          potrzebują pomocy i wsparcia w gąszczu wielu niezrozumiałych
          przepisów. Nasze biuro powstało, by wesprzeć w opracowaniu
          dokumentacji kadrowej, płacowej i wielu innych obowiązkach, jakie
          ciążą na pracodawcach i ich przedsiębiorstwach.
        </p> */}
      </div>
      <div className="second"></div>
    </div>
  );
}
